import React from 'react';

import './GondulaFilter.css';

const GondulaFilter = (props) => {
  const dropdownChangeHandler = (event) => {
    props.onChangeFilter(event.target.value);
  };

  return (
    <div className='gondula-filter'>
      <div className='gondula-filter__control'>
        <label>Filter by Gondula#</label>
        <select value={props.selected} onChange={dropdownChangeHandler}>
          <option value='2022'>1</option>
          <option value='2021'>2</option>
          <option value='2020'>3</option>
          <option value='2019'>4</option>
        </select>
      </div>
    </div>
  );
};

export default GondulaFilter;
